import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with domcontentloaded to avoid timeout
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Click on the first product card to open modal
    await page.click('.product-card:first-child');

    // Wait for modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000, state: 'visible' });

    // Wait for product details to load in modal
    await page.waitForSelector('.product-detail-title', { timeout: 5000 });

    // Take screenshot of opened modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract product title from modal
    const productTitle = await page.$eval('.product-detail-title', el => el.textContent.trim());

    return {
      success: true,
      action: "Opened product detail modal successfully",
      extractedData: {
        productTitle: productTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
